  getMusicVideosByArtist(artist: string, maxCount?: number): Observable<MediaResponse> {
    const url = `${this.baseUrl}/search`;
    let params: HttpParams = new HttpParams();
    params.set('term', artist); // ex: jack+johnson
    if (maxCount) {
      params.set('limit', `${maxCount}`);
    }
    return this.http.get<MediaResponse>(url,{params: params});
  }

